Reference on render (or default) purpose to the bindings layer (located in "bnd" directory).
```
#usda 1.0
def Xform "ModelName"
{
    def Scope "render"
    {
        uniform token purpose = "render"

        def Scope "mdl1" (
            kind = "group"
            prepend references = [
                @bnd/mdl1_default.usd@,
                @geo/mdl1_render.usd@
            ]
        )
    }
...
```

Create a stage with following structure that will be used to create material bindings using same 
namespace than the stage loading the component layer. 
Material bindings will be authored in the sublayer ("bnd/mdl1_default.usd" in this example).
```
#usda 1.0
(
    defaultPrim = "mdl1"
    subLayers = [
        @bnd/mdl1_default.usd@
    ]
)

def Xform "mdl1" (
    prepend references = @geo/mdl1_render.usd@</mdl1_default>
)
{
    def Scope "mtl" (
        prepend references = @mtl/material_library.usd@</mtl>
    )
    {
    }
}
```
